  `P2D` varchar(8) DEFAULT NULL COMMENT '전전일',
  `P1D` varchar(8) DEFAULT NULL COMMENT '전일',
  `N1D` varchar(8) DEFAULT NULL COMMENT '익일',
  `N2D` varchar(8) DEFAULT NULL COMMENT '익익일',
  `N3D` varchar(8) DEFAULT NULL COMMENT '익익익일',
  `CLND_YMD` varchar(8) DEFAULT NULL COMMENT '음력일자',
  `LPM_YN` varchar(1) DEFAULT NULL COMMENT '윤달여부',
  `RMK` varchar(500) DEFAULT NULL COMMENT '비고',
  `MODI_DT` date DEFAULT NULL COMMENT '수정일지',
  PRIMARY KEY (`BASE_YMD`)
