DROP TABLE IF EXISTS `wf_action_use`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wf_action_use` (
  `wf_action_use_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '액션 USE ID',
  `wf_state_use_id` int(11) DEFAULT NULL COMMENT '스테잍트 USE ID',
  `wf_action_id` int(11) DEFAULT NULL COMMENT '액션 모델 ID',
  `wf_action_name` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '액션 이름',
  `wf_action_desc` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '액션 설명',
  `wf_state_id` int(11) DEFAULT NULL COMMENT '스테이트 모델 ID',
  `wf_action_type` varchar(45) DEFAULT NULL COMMENT '액션 타입',
  `wf_action_approve_item_id` int(11) DEFAULT NULL COMMENT '결재 아이템 ID',
  `wf_action_order` int(11) DEFAULT NULL COMMENT '스테이트에서 액션 표시/동작 순서',
  `wf_action_user_id` varchar(45) DEFAULT NULL,
  `wf_reg_id` varchar(45) CHARACTER SET utf16 DEFAULT 'admin',
  `wf_reg_date` datetime DEFAULT current_timestamp(),
  `wf_mod_id` varchar(100) CHARACTER SET utf16 DEFAULT NULL,
  `wf_mod_date` datetime DEFAULT NULL,
  `wf_del_yn` char(1) CHARACTER SET latin1 NOT NULL DEFAULT 'N',
  `wf_approved_yn` char(1) DEFAULT 'N' COMMENT '해당 단계가 끝났는지(완료했는지, 결재했는지)에 대한 상태체크',
  PRIMARY KEY (`wf_action_use_id`),
  KEY `wf_action_use_wf_action_use_id_IDX` (`wf_action_use_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2800 DEFAULT CHARSET=utf8mb4 COMMENT='1. 액션 USE 테이블\r\n2. 업무요청, 개발계획 등이 생성될 때 각 데이터들이 개별로 가지게 되는 액션들에 대한 데이터를 가지는 테이블\r\n3. 액션 모델에서 복사되어 기본 데이터가 생성되며, 처리 결과 등을 가진다.';
/*!40101 SET character_set_client = @saved_cs_client */;

