DROP TABLE IF EXISTS `wf_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wf_master` (
  `wf_master_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '워크플로우 마스터 ID',
  `wf_master_name` varchar(45) NOT NULL COMMENT '워크플로우 마스터 이름',
  `wf_master_desc` varchar(1000) DEFAULT NULL COMMENT '워크플로우 마스터 설명',
  `wf_type_code` varchar(45) DEFAULT NULL COMMENT '1. 워크플로우 마스터 타입코드(표준업무요청, 표준개발계획, 긴급배포.. etc)\r\n2. common code 테이블에서 WF_TYPE 의 값을 가진다.',
  `wf_display_order` int(11) DEFAULT 999999 COMMENT 'UI 상 표시되는 순서를 지정 - WF_TYPE 별 지정값을 가지도록 한다.',
  `wf_reg_id` varchar(45) NOT NULL,
  `wf_reg_date` datetime NOT NULL DEFAULT current_timestamp(),
  `wf_mod_id` varchar(45) DEFAULT NULL,
  `wf_mod_date` datetime DEFAULT NULL,
  `wf_del_yn` char(1) NOT NULL DEFAULT 'N',
  PRIMARY KEY (`wf_master_id`),
  UNIQUE KEY `workflow_id_UNIQUE` (`wf_master_id`)
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8mb4 COMMENT='1. 워크플로우 모델 정보를 가지는 테이블\r\n2. 워크플로우는 모델 > 스테이트 > 액션 순으로 (계층화하여)구조화 되는 관계\r\n3. 업무요청을 생성하는 경우 wf_master_id 를 선택하여 업무요청, 개발요청을 생성하는 단계에서 해당 업무에 맞는 업무용 워크플로우모델이 정해진다.\r\n4. 이후 모델 정보는 해당 _use 테이블로 복사한 뒤 실제 업무 프로세스를 진행한다.\r\n5. 워크플로우타입추가 => 업무요청, 개발계획, 원복요청, 폐기요청 (공통코드테이블에 정의)...';
/*!40101 SET character_set_client = @saved_cs_client */;

