--
-- Table structure for table `wr_approval`
--

DROP TABLE IF EXISTS `wr_approval`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wr_approval` (
  `wr_approval_id` int(11) NOT NULL AUTO_INCREMENT,
  `wf_action_use_id` int(11) DEFAULT NULL,
  `wr_master_id` int(11) DEFAULT NULL,
  `wr_task_id` int(11) DEFAULT NULL,
  `wr_approval_req_type_code` varchar(45) DEFAULT NULL COMMENT '결제요청유형\r\n:: APPR_REQ_TYPE 카테고리 내용중 선택 \r\nex.)  WR_APPROVE / 업무요청서승인요청',
  `wr_approval_req_comment` varchar(300) DEFAULT NULL COMMENT '결제 요청자 요청 의견',
  `wr_approval_ref_id` int(11) DEFAULT NULL COMMENT '결제 요청 참조 아이디(APPR_REQ_TYPE 에 따라 참조 테이블을 달리하도록 구성한다.)\r\n\r\n“WR_APPROVE” -  wr_master - wr_master_id\r\n“DP_APPROVE” - wr_task - wr_task_id\r\n...\r\n...',
  `wr_approval_req_user_id` varchar(45) DEFAULT NULL COMMENT '결제 요청자 아이디',
  `wr_approval_state_code` varchar(45) DEFAULT 'N' COMMENT '결지완료 여부',
  `wr_reg_id` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `wr_reg_date` datetime DEFAULT current_timestamp(),
  `wr_mod_id` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `wr_mod_date` datetime DEFAULT NULL,
  `wr_del_yn` char(1) DEFAULT 'N',
  PRIMARY KEY (`wr_approval_id`),
  KEY `wr_approval_wr_approval_id_IDX` (`wr_approval_id`) USING BTREE,
