--
-- Table structure for table `wr_attach_file`
--

DROP TABLE IF EXISTS `wr_attach_file`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wr_attach_file` (
  `wr_attach_file_id` int(11) NOT NULL AUTO_INCREMENT,
  `wr_master_id` int(11) DEFAULT NULL COMMENT '업무개발요청 id',
  `wr_task_id` int(11) DEFAULT NULL COMMENT '개발계획 id',
  `wf_action_use_id` int(11) DEFAULT NULL COMMENT '워크플로우 action use id',
  `wr_file_attach_type` varchar(45) DEFAULT NULL COMMENT '파일 업로드 wf_common_code값',
  `wr_file_attach_ref_id` int(11) DEFAULT NULL COMMENT '파일 업로드 각 고유한 id값에 매핑(ex. wr_inspection > wr_insp_id)',
  `wr_file_path` varchar(255) DEFAULT NULL COMMENT '첨부파일 경로',
  `wr_file_name` varchar(255) DEFAULT NULL COMMENT '파일명',
  `wr_file_real_name` varchar(255) DEFAULT NULL COMMENT '실제 저장된 파일명',
  `wr_file_ext` varchar(255) DEFAULT NULL COMMENT '파일확장자',
  `wr_file_size` int(11) DEFAULT NULL COMMENT '파일크기(byte)',
  `wr_file_download_url` varchar(255) DEFAULT NULL COMMENT '직접받을수 있는 URL',
  `wr_reg_id` varchar(255) DEFAULT NULL,
  `wr_reg_date` datetime DEFAULT current_timestamp(),
  `wr_del_yn` varchar(1) DEFAULT 'N',
  PRIMARY KEY (`wr_attach_file_id`),
  KEY `wr_attach_file_wr_attach_file_id_IDX` (`wr_attach_file_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COMMENT='1. 첨부파일을 관리하기 위한 테이블\r\n\r\n2. 각 요소별 ID 와 매핑 시켜 관리한다.\r\n\r\n3. 첨부파일을 관리할 요소가 추가되는 경우 컬럼을 추가한다.\r\n- wr_task_id : 개발 계획 ID 와 매핑\r\n- wr_reply_id : 댓글 ID 와 매핑\r\n- 기타 필요한 요소가 생기는 경우 컬럼을 추가하고 매핑한다.\r\n\r\n4. 첨부파일을 추가한 상대 요소(액션, 업무요청)는 첨부파일이 있는지에 대한 여부만 가지고 있는 경우, 이 테이블에서 ID 를 조회하여 첨부파일 정보를 획득한다.';
/*!40101 SET character_set_client = @saved_cs_client */;

