--
-- Table structure for table `wr_master`
--

DROP TABLE IF EXISTS `wr_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wr_master` (
  `wr_master_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '업무개발요청 Index',
  `wf_master_use_id` int(11) NOT NULL COMMENT '워크플로우 사용 모델러의 Master Use Id',
  `wr_code` varchar(45) DEFAULT NULL COMMENT '업무개발요청건 ID(번호/문서번호)',
  `wf_action_use_id` int(11) DEFAULT NULL COMMENT '워크플로우 모델 액션 ID(실제 워크플로우에서 사용하고자 하는 워크플로우 모델 Action Use Id)',
  `wr_dept_chief` varchar(45) DEFAULT NULL COMMENT '업무 요청자의 담당 부서장 (사용자 ID)',
  `ict_dept` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ICT 메인 담당자 소속 부서',
  `ict_dept_chief` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ICT 메인 담당자의 부서장',
  `ict_req_officer` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ICT 메인 담당자',
  `wr_work_type` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '업무유형(신규개발/변경개발/제도변경 : Common Code 의 REQ_TYPE)',
  `wr_consumer_service_yn` char(1) DEFAULT 'N' COMMENT '신규/대고객서비스인지 선택한 값  Y/N',
  `wr_process_reviewer` varchar(45) DEFAULT NULL COMMENT '신규/대고객서비스 담당자 (사용자ID)',
  `wr_process_review_report` varchar(300) DEFAULT NULL COMMENT '신규/대고객서비스 보고서 내용(텍스트)',
  `wr_secret_yn` varchar(45) DEFAULT 'N' COMMENT '업무 비공개 처리 Y/N 선택값',
  `wr_self_yn` char(1) DEFAULT 'N' COMMENT 'ICT 자체개발 건 선택  Y/N',
  `wr_priority` varchar(45) DEFAULT '0' COMMENT '업무개발요청에 대한 우선순위 설정 값(높음/중간/낮음 : Common COde 의 REQ_PRIORITY)',
  `wr_due_date` datetime DEFAULT NULL COMMENT '마감일(날짜입력)',
  `extend_due_date` datetime DEFAULT NULL COMMENT '일정변경 요청시',
  `wr_name` varchar(500) DEFAULT NULL COMMENT '업무개발요청 제목',
  `wr_desc` text DEFAULT NULL COMMENT '요청사항(개발요건)',
  `wr_requirements` varchar(500) DEFAULT NULL COMMENT '개발목적',
  `wr_expected_result` varchar(500) DEFAULT NULL COMMENT '기대효과',
  `wr_related_dp` varchar(100) DEFAULT NULL,
  `wr_file` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '(Y/N) 첨부파일(구조변경예정 첨부파일 관리 테이블과 ID 연결 형태로 변경 예정)',
  `wr_attach_file_yn` char(1) DEFAULT 'N' COMMENT '첨부파일을 가지는지 여부를 체크, 첨부파일이 있는 경우 ID를 가지고 wr_attach_file 테이블에서 첨부파일을 검색하여 가지고 온다.',
  `wr_state_code` varchar(45) NOT NULL DEFAULT 'OPEN',
  `wr_reg_id` varchar(45) DEFAULT NULL COMMENT '업무요청자 (*현업담당자)',
  `wr_reg_date` datetime DEFAULT current_timestamp() COMMENT '업무개발요청 등록 일자',
  `wr_mod_id` varchar(45) DEFAULT NULL COMMENT '마지막 수정한 사람 ID 기록',
  `wr_mod_date` datetime DEFAULT NULL COMMENT '마지막 수정일자',
  `wr_del_yn` char(1) DEFAULT 'N' COMMENT '삭제 플래그 지정값 Y/N',
  PRIMARY KEY (`wr_master_id`),
  UNIQUE KEY `request_id_UNIQUE` (`wr_master_id`)
) ENGINE=InnoDB AUTO_INCREMENT=174 DEFAULT CHARSET=utf8mb4 COMMENT='1. 업무요청 내용을 작성하는 테이블';
/*!40101 SET character_set_client = @saved_cs_client */;

