CREATE TABLE `wr_task` (
  `wr_task_id` int(11) NOT NULL AUTO_INCREMENT,
  `wf_master_use_id` int(11) DEFAULT NULL COMMENT '워크플로우 마스터 모델 사용 ID',
  `wr_task_code` varchar(100) DEFAULT NULL COMMENT '개발계획 문서번호(코드)',
  `wr_master_id` int(11) DEFAULT NULL COMMENT '개발계획이 속한 업무요청 ID',
  `wf_action_use_id` int(11) DEFAULT NULL COMMENT '개발계획에 해당하는 액션 모델 사용 ID',
  `wr_task_seq` int(11) DEFAULT NULL COMMENT '업무개발요청내에서 해당 개발계획의 순서(번호)',
  `wr_task_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '개발계획 이름',
  `wr_task_desc` text DEFAULT NULL,
  `wr_task_reason` varchar(100) DEFAULT NULL COMMENT '긴급개발계획시 사유(공통코드 참조)',
  `wr_task_owner` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '개발계획 소유자',
  `wr_task_change_mgmt_yn` char(1) DEFAULT NULL,
  `wr_task_change_mgmt_officer_id` varchar(45) DEFAULT NULL,
  `wr_task_change_mgmt_report` varchar(100) DEFAULT NULL,
  `wr_task_channel` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '채널',
  `wr_task_require_compliance_yn` char(1) NOT NULL DEFAULT 'N',
  `wr_task_require_qc_yn` char(1) NOT NULL DEFAULT 'N',
  `wr_related_dp` varchar(100) DEFAULT NULL,
  `wr_task_due_date` datetime DEFAULT NULL,
  `wr_state_code` varchar(45) NOT NULL DEFAULT 'OPEN',
  `wr_reg_id` varchar(45) DEFAULT NULL COMMENT '개발계획 등록자 ID',
  `wr_reg_date` datetime DEFAULT current_timestamp() COMMENT '개발계획 등록일',
  `wr_mod_id` varchar(45) DEFAULT NULL COMMENT '개발계획 수정자 ID',
  `wr_mod_date` datetime DEFAULT NULL COMMENT '개발계획 수정일',
  `wr_del_yn` char(1) DEFAULT 'N' COMMENT '개발계획 삭제 여부',
  PRIMARY KEY (`wr_task_id`),
  UNIQUE KEY `wr_task_id_UNIQUE` (`wr_task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8mb4 COMMENT='1. 개발계획을 작성하는 테이블';
