DELIMITER ;;
CREATE  PROCEDURE `getCompUser`()
BEGIN

	CREATE TEMPORARY TABLE IF NOT EXISTS comp_user (

	SELECT

		wf_user_group_mapping.wf_user_id, 

		wf_user_group_role_mapping.wf_role_id, 

		wf_role.wf_role_code

	FROM

		wf_user_group_mapping

	INNER JOIN

		wf_user_group_role_mapping

	ON 

		wf_user_group_mapping.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

	INNER JOIN

		wf_role

	ON 

		wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

	WHERE wf_role_code in ('ROLE_INSP_COMPLIANCE'));

	SELECT * FROM comp_user;

	CREATE TEMPORARY TABLE IF NOT EXISTS getMasterTaskActions (
	SELECT
		wr_master.wr_master_id as idx, 
		wr_master.wr_code as code,
		wf_master_use.wf_type_code,
		wr_master.wf_action_use_id, 
		wr_master.wr_name as subject,
		wf_action_use.wf_action_type, 
		wf_state_use.wf_state_order, 
		wf_action_use.wf_action_order
	FROM
		wr_master
		INNER JOIN
		wf_master_use
		ON 
		wr_master.wf_master_use_id = wf_master_use.wf_master_use_id
		INNER JOIN
		wf_state_use
		ON 
			wr_master.wf_master_use_id = wf_state_use.wf_master_use_id
		INNER JOIN
		wf_action_use
		ON 
			wf_state_use.wf_state_use_id = wf_action_use.wf_state_use_id
	UNION 
	SELECT
		wr_task.wr_task_id as idx, 
		wr_task.wr_task_code as code, 
		wf_master_use.wf_type_code,
		wr_task.wf_action_use_id, 
		wr_task.wr_task_name as subject, 
		wf_action_use.wf_action_type, 
		wf_state_use.wf_state_order, 
		wf_action_use.wf_action_order
	FROM
		wr_task
		INNER JOIN
		wf_master_use
		ON 
		wr_task.wf_master_use_id = wf_master_use.wf_master_use_id	
		INNER JOIN
		wf_state_use
		ON 
			wr_task.wf_master_use_id = wf_state_use.wf_master_use_id
		INNER JOIN
		wf_action_use
		ON 
			wf_state_use.wf_state_use_id = wf_action_use.wf_state_use_id
	ORDER BY code);
	SELECT * FROM getMasterTaskActions;

END ;;
DELIMITER ;
