		INNER JOIN wf_user_group_role_mapping ON wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role ON wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_REQ' AND wf_user_group_mapping.wf_user_id = userId

	);



	

	SET @insp_compliance_user =

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN	wf_user_group_mapping ON wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN wf_user_group_role_mapping ON wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role ON wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_COMPLIANCE' AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	SET @insp_qa_user = 

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN wf_user_group_mapping ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN	wf_user_group_role_mapping ON wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role ON wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_QA' AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	SET @test_qc_user = 

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN wf_user_group_mapping ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN wf_user_group_role_mapping ON wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role ON wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_TEST_QC'	AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	CREATE TEMPORARY TABLE IF NOT EXISTS action_tree

	(

		SELECT

			wf_master_use.wf_master_use_id,

			wf_master_use.wf_type_code,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code 

			 WHERE wf_common_code.wf_category = 'WF_TYPE' AND wf_common_code.wf_common_code = wf_master_use.wf_type_code

			) AS wf_type,

			wf_action_use.wf_action_use_id,

			wf_action_use.wf_action_type,

			wf_action_use.wf_approved_yn

		FROM

			wf_master_use

		INNER JOIN wf_state_use ON wf_state_use.wf_master_use_id = wf_master_use.wf_master_use_id

		INNER JOIN wf_action_use ON wf_action_use.wf_state_use_id = wf_state_use.wf_state_use_id

		WHERE wf_action_use.wf_del_yn = 'N'	

	);



	

	CREATE TEMPORARY TABLE IF NOT EXISTS todo_list

	(	SELECT

			action_tree.wf_master_use_id,

			wr_master.wr_master_id,

			0 AS wr_task_id,

			action_tree.wf_action_use_id,

			action_tree.wf_action_type,

			action_tree.wf_approved_yn,

			CASE WHEN

				(SELECT COUNT(wr_nego_review_id) FROM wr_nego_review WHERE wr_master_id = wr_master.wr_master_id) > 0

			THEN 'Y' ELSE 'N' END AS insp_wr_yn,

			'N' AS wr_task_require_compliance_yn,

			'N' AS wr_task_require_qc_yn,

			(SELECT wf_common_code.wf_common_code_name

			 FROM wf_common_code

			 WHERE wf_category='ACTION_TYPE' AND wf_common_code = action_tree.wf_action_type) AS action_name,

			(SELECT wf_common_code.wf_common_code_name

			 FROM wf_common_code

			 WHERE wf_category='WR_STATE' AND wf_common_code = wr_master.wr_state_code

			 ) AS state,			 

			wr_master.wr_state_code,

			wr_master.wr_reg_id,

			wr_master.wr_reg_date

		FROM

			wr_master

			INNER JOIN action_tree ON action_tree.wf_master_use_id = wr_master.wf_master_use_id

		WHERE wr_master.wr_state_code <> 'CLOSED'			

		UNION

		SELECT

			action_tree.wf_master_use_id,

			wr_task.wr_master_id,

			wr_task.wr_task_id,

			action_tree.wf_action_use_id,

			action_tree.wf_action_type,

			action_tree.wf_approved_yn,

			'N' AS insp_wr_yn,

			wr_task.wr_task_require_compliance_yn,

			wr_task.wr_task_require_qc_yn,

			(SELECT wf_common_code.wf_common_code_name

			 FROM wf_common_code

			 WHERE wf_category='ACTION_TYPE' AND wf_common_code = action_tree.wf_action_type

			 ) AS action_name,

			(SELECT wf_common_code.wf_common_code_name

			 FROM wf_common_code

			 WHERE wf_category='WR_STATE' AND wf_common_code = wr_task.wr_state_code

			 ) AS state,			 

			wr_task.wr_state_code,

			wr_task.wr_reg_id,

			wr_task.wr_reg_date

		FROM

			wr_task

			INNER JOIN action_tree ON action_tree.wf_master_use_id = wr_task.wf_master_use_id

		WHERE wr_task.wr_state_code <> 'CLOSED'				

	);



	

	CREATE TEMPORARY TABLE IF NOT EXISTS wfs

	(	SELECT

			todo_list.wf_master_use_id,

			todo_list.wr_master_id,

			todo_list.wr_task_id,

			todo_list.wf_action_use_id,

			todo_list.wf_action_type,

			todo_list.wf_approved_yn,

			CASE 

				WHEN todo_list.insp_wr_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_REQ' AND @insp_req_user > 0 THEN userId

				WHEN todo_list.wr_task_require_compliance_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_COMPLIANCE' AND @insp_compliance_user > 0 THEN userId

				WHEN wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_QA' AND @insp_qa_user > 0 THEN userId

				WHEN todo_list.wr_task_require_qc_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_TEST_QC' AND @test_qc_user > 0 THEN userId

				ELSE wr_related_user.user_id

			END AS userId

		FROM

			todo_list

			LEFT JOIN wf_action_user_type_mapping ON todo_list.wf_action_type = wf_action_user_type_mapping.wf_action_type

			LEFT JOIN wr_related_user ON wr_related_user.wr_master_id = todo_list.wr_master_id

			AND wf_action_user_type_mapping.wf_user_type = wr_related_user.wr_user_type_code

		GROUP BY todo_list.wf_master_use_id, todo_list.wf_action_use_id 	

	);



	IF (SELECT COUNT(*) FROM wfs WHERE wfs.userId = userId) = 0 THEN

		SELECT 0 AS doneCnt, 0 AS totCnt;

	ELSE

		SELECT 

			SUM(CASE WHEN A.wf_approved_yn = 'Y' THEN 1 ELSE 0 END) AS doneCnt,

			COUNT(A.wf_action_use_id) AS totCnt

		FROM wfs A 

		WHERE A.userId = userId;

	END IF;	

END ;;
DELIMITER ;
