CREATE  PROCEDURE `getWorksTodo`(

	 IN userId VARCHAR(45),

	 IN regStDate VARCHAR(10),

	 IN regEndDate VARCHAR(10),

	 IN dueStDate VARCHAR(10),

	 IN dueEndDate VARCHAR(10),

	 IN searchType VARCHAR(45),

	 IN searchText VARCHAR(45),

	 IN rslt_size INT(11),

	 IN rslt_limit INT(11)

)
BEGIN

	DROP TEMPORARY TABLE IF EXISTS action_tree;

	DROP TEMPORARY TABLE IF EXISTS todo_list;

	DROP TEMPORARY TABLE IF EXISTS wfs;

	DROP TEMPORARY TABLE IF EXISTS wfs_user;



	

	SET @insp_req_user = 

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN wf_user_group_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN wf_user_group_role_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role

		ON	wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_REQ'

		AND wf_user_group_mapping.wf_user_id = userId

	);



	

	SET @insp_compliance_user =

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN	wf_user_group_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN wf_user_group_role_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role

		ON	wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_COMPLIANCE'

		AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	SET @insp_qa_user = 

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN wf_user_group_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN	wf_user_group_role_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role

		ON	wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_INSP_QA'

		AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	SET @test_qc_user = 

	(

		SELECT COUNT(wf_user_group_mapping.wf_user_id)

		FROM wf_user_group

		INNER JOIN wf_user_group_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_mapping.wf_user_group_id

		INNER JOIN wf_user_group_role_mapping

		ON	wf_user_group.wf_user_group_id = wf_user_group_role_mapping.wf_user_group_id

		INNER JOIN wf_role

		ON	wf_user_group_role_mapping.wf_role_id = wf_role.wf_role_id

		WHERE wf_role.wf_role_code = 'ROLE_TEST_QC'

		AND wf_user_group_mapping.wf_user_id = userId			

	);



	

	CREATE TEMPORARY TABLE IF NOT EXISTS action_tree

	(

		SELECT

			A.wf_master_use_id,

			A.wf_type_code,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code 

			 WHERE wf_common_code.wf_category = 'WF_TYPE' AND wf_common_code.wf_common_code = A.wf_type_code

			) AS wf_type,

			MIN(C.wf_action_use_id) AS wf_action_use_id,

			C.wf_action_type,

			C.wf_approved_yn

		FROM

			wf_master_use A

		INNER JOIN wf_state_use B ON B.wf_master_use_id = A.wf_master_use_id

		INNER JOIN wf_action_use C ON C.wf_state_use_id = B.wf_state_use_id

		WHERE A.wf_del_yn = 'N'	AND C.wf_action_type <> 'ACT_EXTEND_DUE_DATE_REQ' AND C.wf_action_type <> 'ACT_EXTEND_DUE_DATE_ICT' 

		AND C.wf_action_use_id > (

			SELECT A1.wf_action_use_id FROM wf_action_use A1

			WHERE 

				A1.wf_state_use_id IN (SELECT B2.wf_State_use_id FROM wf_state_use B2 WHERE B2.wf_master_use_id = A.wf_master_use_id)

				AND A1.wf_approved_yn = 'Y'

			ORDER BY A1.wf_action_use_id DESC LIMIT 1		

			)

		GROUP BY A.wf_master_use_id

		ORDER BY C.wf_action_use_id

	);



	

	CREATE TEMPORARY TABLE IF NOT EXISTS todo_list

	(	

		SELECT

			action_tree.wf_master_use_id,

			wr_master.wr_master_id,

			0 AS wr_task_id,

			wr_master.wr_code AS wr_code,

			action_tree.wf_action_use_id,

			wr_master.wr_name AS subject,

			wr_master.wr_desc AS description,

			wr_master.wr_due_date,

			action_tree.wf_action_type,

			action_tree.wf_type,

			CASE WHEN

				(SELECT COUNT(wr_nego_review_id) FROM wr_nego_review WHERE wr_master_id = wr_master.wr_master_id) > 0

			THEN 'Y' ELSE 'N' END AS insp_wr_yn,

			'N' AS wr_task_require_compliance_yn,

			'N' AS wr_task_require_qc_yn,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code WHERE wf_category='ACTION_TYPE' 

			 AND wf_common_code = action_tree.wf_action_type) AS action_name,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code WHERE wf_category='WR_STATE' 

			 AND wf_common_code = wr_master.wr_state_code ) AS state,			 

			wr_master.wr_state_code,

			wr_master.wr_reg_id,

			(SELECT name FROM wf_users WHERE user_id = wr_master.wr_reg_id) AS wrRegName,

			wr_master.wr_reg_date

		FROM

			wr_master

			INNER JOIN action_tree ON action_tree.wf_master_use_id = wr_master.wf_master_use_id

		WHERE

			wr_master.wr_state_code <> 'CLOSED'	

		UNION

		SELECT

			action_tree.wf_master_use_id,

			wr_task.wr_master_id,

			wr_task.wr_task_id,

			wr_task.wr_task_code AS wr_code,

			action_tree.wf_action_use_id,

			wr_task.wr_task_name AS subject,

			wr_task.wr_task_desc AS description,

			wr_task.wr_task_due_date AS wr_due_date,

			action_tree.wf_action_type,

			action_tree.wf_type,

			'N' AS insp_wr_yn,

			wr_task.wr_task_require_compliance_yn,

			wr_task.wr_task_require_qc_yn,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code

			 WHERE wf_category='ACTION_TYPE' 

			 AND wf_common_code = action_tree.wf_action_type

			 ) AS action_name,

			(SELECT wf_common_code.wf_common_code_name FROM wf_common_code

			 WHERE wf_category='WR_STATE' AND wf_common_code = wr_task.wr_state_code

			 ) AS state,			 

			wr_task.wr_state_code,

			wr_task.wr_reg_id,

			(SELECT name FROM wf_users WHERE user_id = wr_task.wr_reg_id) AS wrRegName,

			wr_task.wr_reg_date

		FROM

			wr_task

			INNER JOIN action_tree ON action_tree.wf_master_use_id = wr_task.wf_master_use_id

		WHERE

			wr_task.wr_state_code <> 'CLOSED'

	);



	CREATE TEMPORARY TABLE IF NOT EXISTS wfs



	(	SELECT

			todo_list.wf_master_use_id,

			todo_list.wr_master_id,

			todo_list.wr_task_id,

			todo_list.wr_code,

			todo_list.wf_action_use_id,

			todo_list.subject,

			todo_list.description,

			todo_list.wr_due_date,

			todo_list.wf_action_type,

			todo_list.action_name,

			todo_list.state,

			todo_list.wr_state_code,

			wf_action_user_type_mapping.wf_user_type,

			todo_list.wf_type,

			todo_list.wr_reg_id,

			todo_list.wrRegName,

			todo_list.wr_reg_date,

			CASE 

				WHEN todo_list.wf_action_type = 'ACT_REQ_INSPECTION' AND todo_list.insp_wr_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_REQ' AND @insp_req_user > 0 THEN userId

				WHEN todo_list.wf_action_type = 'ACT_INSP_COMPLIANCE' AND todo_list.wr_task_require_compliance_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_COMPLIANCE' AND @insp_compliance_user > 0 THEN userId

				WHEN todo_list.wf_action_type = 'ACT_INSP_QA' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_INSP_QA' AND @insp_qa_user > 0 THEN userId

				WHEN todo_list.wf_action_type = 'ACT_QC_TEST' AND todo_list.wr_task_require_qc_yn = 'Y' AND wf_action_user_type_mapping.wf_user_type = 'ROLE_TEST_QC' AND @test_qc_user > 0 THEN userId

				ELSE wr_related_user.user_id

			END AS userId

		FROM

			todo_list

			LEFT JOIN wf_action_user_type_mapping ON todo_list.wf_action_type = wf_action_user_type_mapping.wf_action_type

			LEFT JOIN wr_related_user ON wr_related_user.wr_master_id = todo_list.wr_master_id

			AND wf_action_user_type_mapping.wf_user_type = wr_related_user.wr_user_type_code

	);



	

	SET @searchQry = "CREATE TEMPORARY TABLE IF NOT EXISTS wfs_user

	(

	SELECT 

		A.wf_master_use_id,

		A.wr_master_id,

		A.wr_task_id,

		A.wr_code,

		MIN(A.wf_action_use_id) AS wf_action_use_id,

		A.subject,

		A.description,

		A.wf_action_type,

		A.action_name,

		A.state,

		A.wr_state_code,

		A.wf_user_type,

		A.wf_type,

		A.wr_reg_id,

		A.wrRegName,

		A.wr_reg_date,

		A.wr_due_date

	FROM 

		wfs A 

	WHERE 

		A.userId = '";



	SET @searchQry = CONCAT(@searchQry,userId,"' "); 



	



	IF NOT ISNULL(regStDate) AND regStDate <> '' AND NOT ISNULL(regEndDate) AND regEndDate <> '' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.wr_reg_date BETWEEN '",regStDate,"' AND '",regEndDate, "'");

	END IF;



	IF NOT ISNULL(dueStDate) AND dueStDate <> '' AND NOT ISNULL(dueEndDate) AND dueEndDate <> '' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.wr_due_date BETWEEN '", dueStDate,"' AND '", dueEndDate, "'");

	END IF;



	IF searchType = 'wrRegId' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.wr_reg_id = '", searchText,"' ");

	END IF;



	IF searchType = 'wrRegName' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.wrRegName LIKE '%",searchText,"%' ");

	END IF;



	IF searchType = 'wrSubject' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.subject LIKE '%",searchText,"%' ");

	END IF;



	IF searchType = 'wrCode' THEN

		SET @searchQry = CONCAT(@searchQry, CHAR(10)," AND A.wr_code LIKE '%",searchText,"%' ");

	END IF;			



	SET @searchQry = CONCAT(@searchQry, CHAR(10)," GROUP BY A.wf_master_use_id, A.userId ");

	SET @searchQry = CONCAT(@searchQry, CHAR(10)," ORDER BY wr_master_id, wr_code, wf_action_use_id");	

	SET @searchQry = CONCAT(@searchQry, CHAR(10),")");



	PREPARE tmpQry FROM @searchQry;

	EXECUTE tmpQry;

	DEALLOCATE PREPARE tmpQry;



	SELECT COUNT(*) AS totCnt FROM wfs_user;

	SELECT * FROM wfs_user LIMIT rslt_size OFFSET rslt_limit;

END ;;
DELIMITER ;
